import React from "react";
import { Button, Form, Modal } from "react-bootstrap";
import Message from "../components/Message";
import Loader from "../components/Loader";
import { useDispatch, useSelector } from "react-redux";
import FormContainer from "../components/FormContainer";

import EditSize from "../components/EditSize";
import EditBrand from "../components/EditBrand";

const SpecEditScreen = ({ match, history}) => {

  const specID = match.params.id;
  return (
    <>
    <EditSize id={specID} history={history} />
    <EditBrand id={specID} history={history} />
    </>
  );
};

export default SpecEditScreen;
